import React, { useEffect, useState } from 'react';

const PlansAddOnsPage = () => {
  const [plans, setPlans] = useState([]);

  useEffect(() => {
    const dummyPlans = [
      { id: 1, name: 'Basic Plan', price: 'â‚¹199.00/month', features: ['1 User', 'Basic Support'] },
      { id: 2, name: 'Pro Plan', price: 'â‚¹499.00/month', features: ['5 Users', 'Priority Support', 'Advanced Analytics'] },
      { id: 3, name: 'Add-on: Extra Storage', price: 'â‚¹99.00/month', features: ['50GB Additional Storage'] },
    ];
    setPlans(dummyPlans);
  }, []);

  return (
    <div style={{ padding: '20px' }}>
      <h2 style={{ textAlign: 'center' }}>ðŸ“¦ Plans & Add-ons</h2>
      <div style={{ display: 'flex', gap: '20px', flexWrap: 'wrap', marginTop: '20px' }}>
        {plans.map(plan => (
          <div key={plan.id} style={{
            border: '1px solid #ccc',
            borderRadius: '10px',
            padding: '20px',
            width: '300px',
            boxShadow: '2px 2px 10px rgba(0,0,0,0.1)'
          }}>
            <h3>{plan.name}</h3>
            <p><strong>Price:</strong> {plan.price}</p>
            <ul>
              {plan.features.map((feature, idx) => (
                <li key={idx}>{feature}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PlansAddOnsPage;
